# simply simulate the process
# craft the adj list first
# use bfs with DQ
# a flag indicate 1st minimum value is satisfied

from typing import List
import collections
class Solution:
    def secondMinimum(self, n: int, edges: List[List[int]], time: int, change: int) -> int:
        adj = collections.defaultdict(list)
        for a, b in edges:
            adj[a].append(b)
            adj[b].append(a)
        
        dq = collections.deque()
        dq.append((0, set([1])))            # time, list of nodes
        first_min_val = float('inf')
        while dq:
            t, nodes = dq.popleft()
            # if first_min_val != float('inf') and node not in final_candidates: continue
            
            next_time = t+time
            if (t//change)%2: next_time = time+change*((t//change)+1)        # redlight
            to_add = set()
            for node in nodes:
                for x in adj[node]:
                    to_add.add(x)
                    if x == n:
                        if first_min_val == float('inf'):
                            first_min_val = next_time
                        elif first_min_val != next_time:
                            return next_time
            dq.append((next_time, to_add))
        
        return

